/**
 * @param {number[]} nums
 * @param {number} l
 * @param {number} r
 * @return {number}
 */
var countSubMultisets = function(nums, l, r) {
    const MOD = 1e9 + 7;
    const maxSum = nums.reduce((a, b) => a + b, 0);
    const dpPrev = new Array(maxSum + 1).fill(0);
    const dpCurr = new Array(maxSum + 1).fill(0);
    dpPrev[0] = 1;

    for (const num of nums) {
        for (let sum = 0; sum <= maxSum; sum++) {
            dpCurr[sum] = dpPrev[sum];
            if (sum >= num) {
                dpCurr[sum] += dpPrev[sum - num];
                dpCurr[sum] %= MOD;
            }
        }
        [dpPrev, dpCurr].forEach(arr => dpCurr.fill(0));
    }

    let count = 0;
    for (let sum = l; sum <= r; sum++) {
        count = (count + dpPrev[sum]) % MOD;
    }
    return count;
};
